Array/_.drop.html.body:
_.drop(array, [n=1])
官方解释：

Creates a slice of array with n elements dropped from the beginning.

释义：

创建一个数组切片，从开始删除n个元素。

理解：

从0开始删除n个元素

Since：0.5.0
参数：
array[Array]: 要查询的数组。
[n=1](number): 要删除的元素数量。
返回值：
(Array): 删除之后的的数组
例子：
_.drop([1, 2, 3]);
// => [2, 3]

_.drop([1, 2, 3], 2);
// => [3]

_.drop([1, 2, 3], 5);
// => []

_.drop([1, 2, 3], 0);
// => [1, 2, 3]

